// src/pages/Home.js
import React from 'react';
import HeroSection from '../components/HeroSection';  // HeroSection vai ser o destaque do topo
import Eventos from '../components/Eventos';         // A lista de eventos com os EventCards

const Home = () => {
  // Dados de eventos para testar
  const eventos = [
    { id: 1, name: "Torneio de Casais", date: "17 de março", location: "Arena Nareia", image: "/assets/evento1.jpg" },
    { id: 2, name: "Torneio CONAFE", date: "19 de março", location: "Arena Nareia", image: "/assets/evento2.jpg" },
    { id: 3, name: "Torneio Interno", date: "25 de abril", location: "Itaguaçu Country Club", image: "/assets/evento3.jpg" },
  ];

  return (
    <div>
      <HeroSection />  {/* A seção de destaque do topo */}
      <Eventos eventos={eventos} />  {/* A lista de eventos com os EventCards */}
    </div>
  );
};

export default Home;
